centralbolsonaristta 
O nó na garganta que vocês estão sentindo é o mesmo que eu sinto, mas preciso esclarecer algumas coisas. A esquerda passou décadas se estabelecendo em várias esferas da sociedade (de forma sorrateira, silenciosa) e a direita imatura insiste em querer se estabelecer com um chute na porta. Muita gente dizendo que Bolsonaro deveria ter mandado o povo pra casa. Entendam uma coisa, durante esses dois meses Bolsonaro tentou de tudo (dentro das quatro linhas) mas não obteve apoio. Eu afirmei várias vezes que o nosso querido Presidente não é, nunca foi e jamais será um ditador e, fui muito criticado. Olavo de Carvalho sempre dizia que a posse do Presidente Bolsonaro foi uma ejaculação precoce. Diferente da esquerda, foi eleito antes de ocupar espaços, antes de fortalecer a base. O cenário atual não é o mesmo de 1964. A esquerda faz o que faz porque dominou todo território, avançando estrategicamente por décadas.Eu acredito piamente que o Bolsonaro foi escolhido sob um propósito para um tempo determinado. Hoje somos um povo crítico, cientes de tudo que acontece nas entranhas do sistema. Muitos estão transtornados, as opiniões fluem de todos os cantos e isso é extremamente normal. Deixa fluir. Mas não usem desse momento para causar divisões, pois é exatamente isso que os nossos inimigos querem. Precisamos voltar e pensar a longo prazo. Nós acabamos de entrar no jogo e já tem gente desistindo. Até ontem estávamos dormindo em berço esplendido. Obrigado por tudo Bolsonaro. Você foi gigante.
